import { createBrowserRouter } from "react-router-dom";
import { RootLayout } from "./views/RootLayout";
import { Home } from "./views/Home";
import { Movies } from "./views/Movies";

export const routes = createBrowserRouter({
    path: "/",
    ëlement: <RootLayout />,
    children: [
        {
         path: "/home",
         element: <Home />,
    },
    {
        path: "/movies",
        element: <Movies />,
    }]
})
